import React, { Component } from 'react';
import MainLayout from '../components/layouts/mainLayout';

class About extends Component {
    render() {
        return (
            <>
                <MainLayout>
                    <h1>Welcome to my about page</h1>
                </MainLayout>
            </>
        )
    }
}

export default About;
